INSERT INTO `eval_tutores_preg` (`id`, `pregunta`) VALUES
(1, 'En la primera tutoria pactó reglas de juego? (coherente con el reglamento estudiantil)'),
(2, 'Cumplió con el cronograma establecido para tutorias y evaluaciones?'),
(3, 'Hubo puntualidad y aclaraciones suficientes en el inicio de la Hora de Clase?'),
(4, 'Orientó correctamente el desarrollo de los fascículos de la asignatura?'),
(5, 'El tutor posee amplio conocimiento de su asignatura, y amplía las fuentes de conocimiento y bibliografía?'),
(6, 'Aportó en conocimiento, experiencia y visión complementaria de los contenidos programáticos?'),
(7, 'El conocimiento adquirido fue proyectado socialmente en beneficio de la comunidad local donde usted se desempeña en el entorno que lo rodea?'),
(8, ' Desarrolló valores de pertenencia propios de la misión de nuestra universidad y compromiso institucional en su labor académica?'),
(9, 'Empleó espacios para la investigación, contextos complementarios, internet, video y/o otros?'),
(10, 'En su discurso y en su práctica proyectó profundidad y manejo del tema investigativo?'),
(11, 'Durante todo el proceso académico el tutor fue llevando claras formas de investigación.'),
(12, 'La metodología y la pedagogía desarrollada llenó las espectativas para la comprensión de los diferentes temas?'),
(13, 'Evaluo con imparcialidad y claridad ; atendió oportunamente las asesorías y orientaciones solicitadas por el estudiante? '),
(14, 'Durante las tutorías su relación con los estudiantes fue con cordialidad y profesionalismo?'),
(15, 'A nivel pedagógico es ordenado, claro, concreto y permite avanzar en el proceso del conocimiento?');
